	('       บริษัทของเรา  คือผู้ให้บริการทางด้านเทคโนโลยีและสื่อสารสนเทศครบวงจร โดยให้บริการ\r\nแก่ธุรกิจตั้งแต่ขนาดเล็ก  ไปจนถึงขนาดใหญ่ โดยใช้ เทคโนโลยีสมัยใหม่และเครื่องมือที่ทันสมัย\r\nประกอบกับทีมงานที่มีความเชี่ยวชาญ และคร่ำหวอดอยู่ในวงการเป็นเวลานาน โดยทีมงานส่วนใหญ่ ผ่านการรับรองจากสถาบันต่าง ๆอาทิเช่น CCNA จากบริษัท Cisco ,HCNE จากบริษัท\r\nHuawei , MCP  MCSA, MCSE จากบริษัท Microsoft  และ RHCE Altas เปิดดำเนินการมาตั้งแต่ปี 2543 จนถึงปัจจุบัน  \r\n        เป้าหมายบริษัทฯ คือ ต้องการให้บริการที่ครบวงจร ทั้งทางด้าน Hardware , Software , Network และ Internet โดยให้ตรงกับความต้องการของลูกค้าโดยนำปัญหาต่างๆและความต้องการของลูกค้ามาวิเคราะห์  และหาหนทางที่ดีที่สุดนำกลับไปปรับปรุงและแก้ไข เพื่อให้องค์กรของท่านมีประสิทธิภาพทัดเทียมคู่แข่ง และทำธุรกิจกับตลาดโลกได้อย่างมีประสิทธิภาพต่อไป\r\n	แนวโน้ม ของ Altas จากผลงานที่ผ่านมา ถือได้ว่าบริษัทฯ ได้ประสบความสำเร็จไปอีกขั้นหนึ่ง ในการที่จัดการและบริการลูกค้าจนได้รับความชื่นชม และไว้วางใจ แต่ถึงกระนั้นก็มิได้นิ่งนอนใจ  บริษัทฯ จึงได้เร่งศึกษาและวิจัยแทคโนโลยีใหม่ๆ เพื่อให้ได้บริการลูกค้าอย่างมีประสิทธิภาพ ต่อไปอย่างไม่หยุดยั้ง\r\n       รูปแบบการบริการ\r\n-	Internet & Network\r\n-	E-Business System\r\n-	Web Design\r\n-	Security System\r\n-	Maintenance\r\n-	Software Application\r\n-	Barcode System\r\n-	Outsourcing\r\n-	Software Package\r\n', '../images/business/company_profile.jpg', '@ Structure Cabling Solutions System\r\n	บริษัทของเรารับออกแบบติดตั้งโดยคำนึงถึงส่วนประกอบต่างๆ ของระบบที่ประกอบเข้าด้วยกัน อย่างพิถีพิถันเพื่อให้เกิดประสิทธิภาพกับระบบให้มากที่สุด ซึ่งในส่วนของสายสัญญาณและการติดตั้งก็มีผลเป็นอย่างมากกับประสิทธิภาพโดยตรง ซึ่งในส่วน cabling นี้เรามีรูปแบบการบริการดังต่อไปนี้\r\n- Fiber Optic Solution\r\n- Drop wire\r\n- Cat5 E\r\n- Cat6\r\n- UTP & STP\r\n\r\n\r\n@ E-Business\r\n\r\n	การนำ E-Business เข้ามาประยุกต์ใช้อย่างเหมาะสมจะช่วยกำจัดปัญหาการทำงานที่ยุ่งยากซับซ้อนและเป็นตัวแปรสำคัญไปสู่การทำงานที่สะดวก รวดเร็วพร้อมทั้งมีประสิทธิภาพในการทำงานสูงขึ้น ซึ่งเป็นที่มาของการสร้างกำไรได้เพิ่มมากขึ้น\r\nธุรกิจจำนวนมากที่กำลังประสบกับปัญหาการทำงานที่แสนยุ่งยากสลับซับซ้อนเป็นที่มาของข้อผิดพลาดในการทำงานตัวอย่างเช่น  มีเอกสารจำนวนมากเกินความจำเป็นทำให้ยากต่อการจัดการ  พนักงานไม่สามารถค้นหาข้อมูลภายในองค์กรได้อย่างแม่นยำและรวดเร็วพอ  การตรวจสอบสต็อกสินค้าที่ผิดพลาด ปัญหาเหล่านี้ทำให้ธุรกิจของท่านต้องสะดุดในภาวะการแข่งขันที่นับวันจะมีการแข่งขันที่รุนแรงขึ้นเรื่อย ๆ \r\n	ทางเราเชื่อว่าการนำ  E-Business เข้ามาจะสามารถช่วยแก้ปัญหาต่าง ๆ ของท่านได้ โดยที่รูปแบบการบริการทางด้าน E-Business ของเรามีดังนี้\r\n\r\nBusiness Intelligence\r\n\r\n	Database Design\r\n	Business Process Integration\r\n	Application Integration\r\n	Facilities Management System\r\n	Data Storage & Management\r\nInformation Technology Integration\r\n\r\n	Internet Communication\r\n	Network Communication\r\n	Web Communication\r\n	Windows 2003 (File Server & Active Directory)\r\n	Server To Desktop\r\n\r\nWeb Services\r\n\r\n	Web Design\r\n	Web Application Programming\r\n	Web Database\r\n\r\n\r\n\r\n\r\n\r\n\r\n@ Web Design\r\n\r\n	เว็ปไซด์ของบริษัทก็เปรียบเสมือนหน้าตาของบริษัท ถ้าเวปไซด์ของบริษัทท่าน ทำออกมาแล้วดูดีก็จะสร้างภาพลักษณ์และความน่าเชื่อถือให้กับลูกค้าของท่านเป็นอย่างมาก  แต่ถ้าเวปไซด์ของท่านทำออกมาแล้วไม่ดี ท่านอาจจะเสียผลประโยชน์ทางธุรกิจ  อย่างที่ท่านอาจคาดไม่ถึงก็เป็นได้   ดังนั้นบริษัทของเราจึงเล็งเห็นความสำคัญในส่วนนี้ เราจึงให้ความสำคัญในการออกแบบเวปไซด์  ให้บริษัทของท่านดูมีความน่าเชื่อถือ และช่วยเสริมศักยภาพให้บริษัทของท่าน เป็นที่พึงพอใจของลูกค้า และ เพิ่มส่วนแบ่งทางการตลาดให้เพิ่มมากขึ้นต่อไปในอนาคต โดยการออกแบบของเรามีหลากหลายรูปแบบดังต่อไปนี้\r\n\r\n	News แสดงข้อมูลข่าวสาร\r\n	กระดานถามตอบ\r\n	โพสรูป ร่วมแสดงความคิดเห็น\r\n	แบบสำรวจความคิดเห็น (Poll, Vote)\r\n	ระบบ Login และการสมัครสมาชิก \r\n	ระบบซื้อขายสินค้าผ่านเวปไซต์\r\n	ระบบจัดการสินค้าคงคลังผ่านเวปไซต์\r\n	กราฟฟิกแบบเคลื่อนไหว (Flash Animation)\r\n\r\n\r\n\r\nโปรแกรมที่ใช้ในการออกแบบ\r\n\r\n	HTML\r\n	PHP\r\n	.NET\r\n	SQL\r\n	Graphic Design\r\n	Flash Animation\r\n	Flash Presentation\r\n\r\n\r\n@ Security\r\n\r\n	เนื่องจากอินเตอร์เนตเป็นสื่อสาธารณะที่ไม่ว่าใครจากทั่วทุกมุมโลก ก็เข้ามาใช้งานได้  ดังนั้นภัยมืดทางอินเตอร์เนตจึงมีมากมายเป็นเงาตามตัวมาด้วย  ซึ่งถ้าบริษัทของท่านไม่มีการเตรียมตัวรับมือกับภัยมืดทางอินเตอร์เนต นี้อย่างดีพอ อาจก่อให้เกิดความเสียหายกับบริษัทของท่านอย่างมาก ซึ่งปัญหาในปัจจุบันนับวันจะรุนแรงมากขึ้นอย่าง Virus , Spyware , Spam Mail , และ Hacker  ดังนั้นถ้าองค์กรของท่านไม่ประมาทและเตรียมตัวรับมืดกับภัยมืดนี้เป็นอย่างดีแล้ว รับรองว่าท่านจะไม่ต้องมานั่งกลุ้มใจกับเรื่องที่จะเกิดขึ้นในอนาคตอย่างแน่นอน  ซึ่งการบริการในส่วนของ security  ของเรามีดังต่อไปนี้\r\n\r\n\r\nNetwork and Information Security\r\n\r\n	Securing Internet (Virus, Worm, Spyware)\r\n	Securing Network Infrastructure (Firewall, IDS ,ACL)\r\n	Securing User Services (Active Directory , Group Policy)\r\n	Securing Remote Access (VPN, SSH, SSL)\r\n	Securing Devices Implementation\r\n\r\nVirus Prevention\r\n\r\n	Desktop Protection\r\n	Server Protection\r\n	Mail Server Protection\r\n	Network Protection\r\n	Gateway Protection\r\n\r\n\r\n\r\n\r\nScanning and Secure Platforms\r\n\r\n	Vulnerability Scanning (Windows Server, Linux, Unix)\r\n	Securing Workstation & Server\r\n	Securing Network\r\n	Securing Update & Advisory\r\n\r\n\r\n\r\n@ Outsourcing\r\n\r\n	ไม่มีอะไรแย่ไปกว่าการที่ธุรกิจของท่านได้ทำการลงทุนเป็นเงินจำนวนมหาศาลไปกับแผนก IT และ Network ชั้นดีแต่กับต้องทนอยู่กับปัญหา  \r\n  ไม่มีคนคอยดูแลระบบ หรือมีแต่พอเก่งแล้วก็ออกไปหาที่ทำงานใหม่ \r\n  คอมพิวเตอร์เสียหรือมีปัญหาไม่สามารถใช้งานได้ \r\n  ความล่าช้าของระบบ Internet \r\n ปัญหาระบบเครือข่ายขาดประสิทธิภาพ \r\n  ไวรัสระบาด\r\n  ระบบเครือข่ายและเครื่อง Server ไม่สามารถให้บริการได้ \r\n ปัญหาความไม่ปลอดภัยของข้อมูล  \r\n\r\nซึ่งบริการของเราในส่วนของการ Maintenance มีดังต่อไปนี้\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nNetwork Troubleshooting\r\n\r\n	Physical to Application Layer analysis\r\n	Applications multifunction\r\n	Data capture and analysis of LAN, WAN, Wireless\r\n	Network Bandwidth Monitoring and Analysis\r\n	Real-Time expert analysis\r\n\r\n\r\nServer & Workstation\r\n\r\n	Operation System Problem\r\n	System Backup & Update\r\n	Software Checking\r\n	Monitoring network \r\n\r\nComputer Hardware\r\n\r\n	Workstation Computer\r\n	Server Computer\r\n	Network Devices\r\n	Printer Network\r\n	RFID\r\n\r\nWebsite Maintenance\r\n\r\n	Information Update\r\n	Hosting\r\n	Web Application\r\n	Database Management\r\n\r\nVirus, Worm, Spyware Removal , Hacker\r\n\r\n	Workstation & Server Checking\r\n	Internet & Network Checking\r\n\r\n\r\n\r\n\r\n\r\n@ Training  Service\r\n	ระบบสารสนเทศในปัจจุบันนี้ก้าวหน้าไปอย่างรวดเร็ว  ดังนั้นการทำธุรกิจกับตลาดสากลจึงทำให้องค์กรต้องมีการพัฒนาระบบไปพร้อม ๆ กับบุคลากรภายในองค์กร บริการทางด้านการให้ความรู้และฝึกอบรม (Training Service) จึงเข้ามามีบทบาทที่สำคัญเช่นนี้ในการที่จะพัฒนาบุคลากรซึ่งเป็นปัจจัยที่สำคัญที่สุดในองค์กรให้มีความเข้าใจในระบบเหล่านั้น เพื่อที่จะสามารถนำพาเทคโนโลยีทางด้านระบบเหล่านั้นพัฒนาตนเองและองค์กรให้ประสบความสำเร็จทางด้านต่างๆ อย่างดียิ่งๆ ขึ้นไป \r\n\r\nในส่วนของ Training Service นี้เรามีให้บริการดังนี้\r\n-	Linux for admin                             - Oracle Database             - SQL Server DB\r\n-	Network System for admin            - Informix Database         - DB2 (IBM)\r\n-	Cisco network                                - PostGreSQL DB\r\n-	Network Trouble Shooting            - My SQL DB\r\n', '');
