INSERT INTO `tb_description` (`product`, `business`, `aboutus`, `product_desc_from`, `business_desc_from`, `aboutus_desc_from`, `product_image`, `business_image`, `aboutus_image`, `product_image_desc`, `business_image_desc`, `aboutus_image_desc`) VALUES
	('รับติดตั้งกล้องวงจรปิด\r\nรับติดตั้งระบบ fiber optic\r\nรับติดตั้งระบบคีย์การ์ด\r\nรับติดตั้งรับบรักษาความปลอดภัย\r\nรับติดตั้งสาย VGA HDMI', '          การสร้างระบบงาน ทีมงานมีความคำนึงถึงประสิทธิภาพทั้งการใช้งานในปัจจุบันและอนาคต โดยระบบต้องมีความถูกต้องและแม่นยำ สั่งงานได้ตรงตามที่ต้องการ เชื่อถือได้ มีความสมบูรณ์ ทบทวนต่อความผิดพลาดในระบบได้ มีประโยชน์  มีประสิทธิภาพสามารถพิสูจน์คุณภาพ และบำรุงรักษาได้ง่าย', '		เป็นบริษัทที่ดำเนินธุรกิจแบบครบวงจร การให้บริการและจัดจำหน่ายอุปกรณ์ทางด้านคอมพิวเตอร์ การให้คำปรึกษาทางด้านธุรกิจ การออกแบบ วิเคราะห์และพัฒนาระบบโปรแกรมคอมพิวเตอร์ รวมทั้งการออกแบบและวางระบบเครือข่ายระยะใกล้และไกลอีกด้วย\r\n		บริษัท เอลตัสฯ ได้มีการก่อตั้งโดยการรวมตัวกันของผู้ที่มีความเชี่ยวชาญ และทีมงานที่มีประสบการณ์ ในการวิเคราะห์ออกแบบระบบและพัฒนาระบบงานคอมพิวเตอร์ การออกแบบจัดการระบบเชื่อมต่อของระบบเครือข่ายคอมพิวเตอร์ ด้วยอุปกรณ์ที่ทันสมัยอย่างมีประสิทธิภาพ การให้คำปรึกษาในการลงทุนที่จะนำระบบคอมพิวเตอร์เข้ามาใช้งานไม่ว่าจะเป็นด้าน Hardware หรือ Software ในองค์กรต่าง ๆ ให้เหมาะสมกับปริมาณงานและมีความสอดคล้องเหมาะสมกับรูปแบบขององค์กร ในงบประมาณที่เป็นเหตุเป็นผลกับการใช้งานในแต่ละองค์กร ซึ่งจะสัมพันธ์กับการจัดการระบบฐานข้อมูลขององค์กรที่เหมาะสมด้วย พร้องทั้งการนำเสนอทางเลือกและวิธีการแก้ไขปัญหาหรือความซ้ำซ้อนของระบบงานที่จะเกิดขึ้นในปัจจุบันและอนาคต\r\n		จากผลการดำเนินงานที่ผ่านมาของบริษัท เอลตัส บิสิเนส จำกัด ถือได้ว่า เป็นบริษัทที่ยอมรับในกลุ่มลูกค้า แม้ว่าปัจจุบันเทคโนโลยีด้านคอมพิวเตอร์ จะมีการพัฒนาและเปลี่ยนแปลงไปอย่างมากเพียงใด บริษัทก็ยังคงพัฒนาองค์กรให้ก้าวทัน พร้อมกับการบริการอย่างมีประสิทธิภาพ สามารถตอบสนองความต้องการของลูกค้าต่อไปอย่างไม่หยุดยั้ง\r\n', '', '', '', '../images/description/product_descImage.bmp', '', '../images/description/aboutus_descImage.JPG', 'CCTV Installstion', '', '');
INSERT INTO `tb_network_installation` (`description`, `image`, `image_desc`, `desc_from`) VALUES
	('การติดตั้งระบบเครื่อข่าย Network Cabling by Cat5e,Cat6,Fiber Optic,VGA\r\nให้คำปรึกษาออกแบบและติดตั้งระบบเครือข่าย สำหรับ สำนักงาน อาคาร โรงงาน\r\n		       ร้านค้า ร้าน Internet ฯลฯ\r\nออกแบบเครือข่ายเพิ่มเติมในกรณีที่มีระบบเดิมอยู่แล้ว โดยทำการตรวจสอบ Traffic และ\r\n       ใช้ Report Tester เพื่อความเสถียรของระบบ \r\nให้การออกแบบ ระบบ Wireless Lan เครือข่ายไร้สาย\r\n', '../images/business/network_installation.jpg', 'Network Installation', '');
