INSERT INTO `tb_outsourcing` (`description`, `image`, `image_desc`, `desc_from`) VALUES
	('Outsourcing   เป็นการบริการเป็นที่ปรึกษาและดูแลระบบคอมพิวเตอร์หรืออื่น ๆ    ที่เกี่ยวข้อง\r\n ด้วยการส่งทีมงานเข้าไปปฏิบัติงานตามความต้องการหรือตามเงื่อนไขที่กำหนด\r\n	3.1 รับปรึกษาและบำรุงรักษาระบบคอมพิวเตอร์และรวมถึงระบบโปรแกรมด้วย\r\n	3.2 รับปรึกษาและบำรุงรักษาระบบคอมพิวเตอร์ \r\n-	PC Server เช่น SCO Unix หรือ LINUX หรือ MS Windows NT,2000,2003 \r\n-	Mini Computer เช่น เครื่อง Sun หรือ Risc6000 \r\n-	Database Server เช่น MS Access,Informix SQL Server,Oracle\r\n3.3 งานที่ปรึกษาวิเคราะห์และออกแบบติดตั้ง รวมถึงการบำรุงรักษาเครือข่ายของ \r\n      คอมพิวเตอร์ (Network System)\r\n3.4 รับวางแผนและพัฒนาระบบและวิเคราะห์และออกแบบระบบงาน\r\n', '../images/business/outsourcing.JPG', '', '');
INSERT INTO `tb_package_software` (`id`, `name`, `description`, `image`, `image_desc`, `enable`, `ordering`) VALUES
	(21, 'ระบบโปรแกรมทรัพยากรบุคคลและค&#63242;าจ&#63243;าง ', 'เป&#63250;นระบบโปรแกรมเกี่ยวกับ พนักงานค&#63242;าจ&#63243;าง การประเมินผลงาน การลงเวลา การ Training การคิดภาษี ประวัติ การเลื่อนขั้นการปรับเงินเดือน', '../images/package_software/package_software_21.JPG', '', 1, 6),
	(19, 'GL General Ledger System ', 'เป&#63250;นระบบบัญชีแยกประเภท ที่สามารถนําไป Interface\r\nเข&#63243;ากับระบบต&#63242;าง ๆ ที่บริษัทได&#63243;ทําการพัฒนา โดยสามารถใช&#63243;ได&#63243;กับโปรแกรมที่เป&#63250;น Package Software และ Tailor made Software\r\n', '../images/package_software/package_software_19.JPG', '', 1, 4),
	(20, 'Registration System ', 'เป&#63250;นระบบการลงทะเบียน เพื่อการสัมมนา สามารถออกใบเสร็จรับเงิน และทําการรับชําระเงิน ผู&#63243;เข&#63243;าร&#63242;วมสัมมนา', '../images/package_software/package_software_20.JPG', '', 1, 5),
	(18, 'ระบบโปรแกรมร&#63243;านอาหาร ', 'เป&#63250;นโปรแกรมบริหารงานร&#63243;านอาหาร ทั่วไป สามารถตรวจสอบยอดขาย ในแต&#63242;ละวัน รวมถึงการควบคุมต&#63243;นทุนการผลิต การซื้อและรับวัตถุดิบ', '../images/package_software/package_software_18.JPG', '', 1, 3),
	(16, 'Trading System เป&#63250;นระบบโปรแกรมการซื้อมาขายไป ', '', '../images/package_software/package_software_1.JPG', '', 1, 1),
	(17, 'Travel Services System ', 'เป&#63250;นระบบการจองตั๋วเครื่องบินและบริการ เช&#63242;นการขายตั๋วเครื่องบิน, โรงแรม, วีซ&#63242;า, รถ, เรือ, ทัวร&#63246; อื่นๆ โดยสามารถพิมพ&#63246; Invoice/Exchange/Voucher/Deposit/Receipt ซึ่งระบบนี้จะสามารถติดตามระบบลูกหนี้และเจ&#63243;าหนี้รวมทั้งการทํางบการเงิน หรือแม&#63243;กระทั่งการทํา สต&#63244;อกตั๋วใบเสร็จรับเงิน และทําการรับชําระเงิน ', '../images/package_software/package_software_17.JPG', '', 1, 2);
