	(38, 'N.C.C. Management & Development Co.,Ltd. (ศูนย&#63246;ประชุมแห&#63242;งชาติสิริกิตร&#63246;)', 'ระบบโปรแกรม 	การลงทะเบียนเพื่อเข&#63243;าสัมมนา ต&#63242;าง ๆ ด&#63243;วยระบบ Visual Basic 6\r\nระบบโปรแกรม	 การประมูลเหรียญ ด&#63243;วยระบบ Visual Basic 6\r\nระบบโปรแกรม	 การประมูล ป.ร.ส. Mobile Phone & Pager และ สนามกอล&#63246;ฟ\r\nระบบโปรแกรม	 การลงทะเบียน เรื่อง ดินโลก รับลงทะเบียนทาง Web และ หน&#63243;างาน\r\nระบบโปรแกรม 	ระบบข&#63243;อมูลการลงทะเบียน Visitor & Exhibitor\r\n', '', '', 1, 14, '', ''),
	(39, 'บริษัท เนปจูน อาหารและเครื่องดื่ม จํากัด', 'ระบบโปรแกรม 	 การขายสินค&#63243;าและสินค&#63243;าคงคลัง ด&#63243;วยโปรแกรม Informix 4GL บนระบบ\r\nปฏิบัติการ SCO UNIX\r\nระบบปฏิบัติการ 	เป&#63250;นที่ปรึกษาและดูแล ระบบ SCO UNIX\r\nป&#63248;จจุบัน เป&#63250;นที่ปรึกษาและดูแลระบบ OS (UNIX) รวมถึงระบบ Network\r\nระบบโปรแกรม	การขายสินค&#63243;าและระบบบัญชีลูกหนี้\r\nระบบโปรแกรม	 สินค&#63243;าคงคลังและระบบการจัดส&#63242;งสินค&#63243;า\r\n', 'พัฒนาระบบด&#63243;วย Delphi 5 บนฐานข&#63243;อมูล SQL Server 2000', '', 1, 15, '', ''),
	(40, 'Philips Electronic (Thailand) Co.,Ltd.', 'ระบบ Customer Services (บริการลูกค&#63243;า Mobile Phone and Pager)', '', '', 1, 16, '', ''),
	(41, 'สํานักงานปลัดทบวงมหาวิทยาลัย', 'ระบบโปรแกรม	การลงทะเบียน เพื่อจัดทํา บัตรประจําตัวและวุฒิบัตร พร&#63243;อมทั้งจัดเก็บในรูปแบบของฐานข&#63243;อมูลเพื่อการวิจัยและพัฒนา โครงการนิสิตนักศึกษาอาสาคุ&#63243;มครองผู&#63243;บริโภค(อสคบ) สําหรับมหาวิทยาลัย จํานวน 50 แห&#63242;งทั่วประเทศ ในสังกัดสํานักงานปลัดทบวงมหาวิทยาลัยพัฒนาระบบด&#63243;วย โปรแกรม MS Visual Basic 6', '', '', 1, 17, '', ''),
	(42, 'บริษัท ศรีรุ&#63242;งเรืองแมชชีนแอนด&#63246;ทูลส&#63246; จํากัด', 'ระบบโปรแกรม 	สินค&#63243;าคงคลัง,ระบบซื้อขาย,ระบบลูกหนี้,เจ้าหนี้', 'พัฒนาระบบด&#63243;วย โปรแกรม Delphi 5\r\nด&#63243;วยฐานข&#63243;อมูล SQL Server 2000 บน MS Windows 2003\r\n', '', 1, 18, '', ''),
	(43, 'TELE DIRECT ASIA COMPANY LIMITED', 'ระบบโปรแกรม 	ระบบเทเลมาเก็ตติ้ง (การขายประกันผ&#63242;านทางโทรศัพท&#63246;)', 'พัฒนาระบบด&#63243;วย โปรแกรม MS Visual Basic 6\r\nด&#63243;วยฐานข&#63243;อมูล PostGreSQL บน Linux Fedora Core 2\r\n', '', 1, 19, '', ''),
	(44, 'บริษัท แปซิฟิค สตรองค์โฮลด์ จำกัด', 'ระบบโปรแกรม 	Business Center (อาคาร/สำนักงานให้เช่า) ', 'พัฒนาระบบด&#63243;วย โปรแกรม Java\r\nด&#63243;วยฐานข&#63243;อมูล PostGreSQL บน Linux Fedora Core 2\r\n', '', 1, 20, '', '');
