	('Delux-001', 'DLP-31A', 'Power Supply Delux', '850', 'Baht', '../images/product/product_icon_file_Delux-001.jpg', '', '../images/product/product_image_file_Delux-001.jpg', '??????????????? ???? DLP-31A ????????????????????????????????? ??????????????????????????????????????? 450 ????? ??? 20+4 ??? ?????? Intel ATX 12V 2.2 ??????????????????????? Core2 Duo / AMD \r\n?????????????????????? CB, CE, FCC, PFC ... ?????????????????????????? (AC) 230 Volt ~ 50 Hz. 4A ???????????????????????????????????????????????????????????????????????????????\r\n\r\n', '', '', 1, 0, 0),
	('DVR-AVC791', 'AVTECH', 'DVR 4CH AVTECH 791 เครื่องบันทึกภาพ 4 H.264', '', 'PCS', '../images/product/product_icon_file_DVR-AVC791.jpg', '../images/product/product_logo_file_DVR-AVC791.jpg', '../images/product/product_image_file_DVR-AVC791.jpg', 'DVR 4CH AVTECH 791 เครื่องบันทึกภาพ 4 ช่องดูผ่าน Net VGA,LAN H.264\r\nเป็นอุปกรณ์ที่รองรับระบบ PAL/NTSC (auto detection)\r\n การบีบอัดข้อมูลภาพเป็นแบบ H.264 \r\n สามารถต่อสัญญาณภาพเพื่อแสดงผลในจอแสดงผลหลักเป็นแบบ BNC และสามารถต่อ VGA ( ต่อจอคอมพิวเตอร์ได้) \r\n มีขนาดของภาพที่บันทึก 3 แบบ \r\nระบบ FRAME 704x480 pixels <NTSC> / 704 x 576 pixels <PAL>\r\nระบบ Field 704x240 Pixels 60 IPS<NTSC> 704 x 288 Pixels 60 IPS<PAL>\r\nระบบ CIF 352x240 pixels 120 IPS <NTSC> / 352x288 pixels 100 <PAL\r\n มีระบบค้นหาภาพอย่างรวดเร็ว แบบกำหนดเวลา และการเคลื่อนไหว\r\n รองรับฮาร์ดดิสก์ 1 ลูก เป็น ฮาร์ดดิส แบบ SATA รองรับ 2TB\r\n รองรับ VGA ที่ความละเอียด 1600x1200 pixel\r\n มีระบบการบันทึกภาพ แบบตั้งเวลาบันทึก, แบบตรวจจับการเคลื่อนไหว, มีการเตือน, บันทึกตลอดเวลา \r\n ระบบ Multiplex ทำงานแยกอิสระต่อกันในการ ดูภาพ บันทึกภาพ เล่นภาพ ระบบ network \r\n รองรับระบบเสียง 4 Input และ 1 Output \r\n มีระบบสำรองข้อมูล USB Backup \r\n มีระบบ LAN 10/100 สามารถดูภาพผ่าน Internet รองรับ TCP/IP, PPPOE, DHCP and DDNS\r\n รองรับการดูภาพด้วย โปรแกรม Internet Explorer, Mozilla Firefox or Google Chrome QuickTime \r\n สามารถดูภาพโดยแยกอิสระโดยไม่กระทบถึงหน้าจอหลัก\r\n รองรับผู้ใช้ สูงสุด 5 user\r\n รองรับการดูภาพผ่านโทรศัพท์ Windows Mobile / Iphone / BlackBerry\r\n มีรีโมทคอนโทรล และรองรับ Mouse USB ได้ \r\n มีระบบการแสดงภาพแบบลำดับภาพ และสามารถตั้งเวลาในการแสดงภาพได้\r\n มีระบบการ Zoom ภาพเมื่อดูภาพสด 2x\r\n สามารถคืนค่าในกรณีที่ไฟฟ้าดับและเปิดขึ้นมาเองโดยค่าต่างๆที่กำหนดไม่มีการเปลี่ยนแปลง\r\n รองรับระบบการรวมภาพจากหลาย DVR มากที่สุด 16 DVR และจำนวนกล้อง 256 กล้อง\r\n', '', 'รับติดตั้งระบบ cctv กล้องวงจรปิด\r\nDVR 4CH AVTECH 791 เครื่องบันทึกภาพ 4 ช่องดูผ่าน Net VGA,LAN H.264\r\nเป็นอุปกรณ์ที่รองรับระบบ PAL/NTSC (auto detection)\r\n การบีบอัดข้อมูลภาพเป็นแบบ H.264 \r\n สามารถต่อสัญญาณภาพเพื่อแสดงผลในจอแสดงผลหลักเป็นแบบ BNC และสามารถต่อ VGA ( ต่อจอคอมพิวเตอร์ได้) \r\n มีขนาดของภาพที่บันทึก 3 แบบ \r\nระบบ FRAME 704x480 pixels <NTSC> / 704 x 576 pixels <PAL>\r\nระบบ Field 704x240 Pixels 60 IPS<NTSC> 704 x 288 Pixels 60 IPS<PAL>\r\nระบบ CIF 352x240 pixels 120 IPS <NTSC> / 352x288 pixels 100 <PAL\r\n มีระบบค้นหาภาพอย่างรวดเร็ว แบบกำหนดเวลา และการเคลื่อนไหว\r\n รองรับฮาร์ดดิสก์ 1 ลูก เป็น ฮาร์ดดิส แบบ SATA รองรับ 2TB\r\n รองรับ VGA ที่ความละเอียด 1600x1200 pixel\r\n มีระบบการบันทึกภาพ แบบตั้งเวลาบันทึก, แบบตรวจจับการเคลื่อนไหว, มีการเตือน, บันทึกตลอดเวลา \r\n ระบบ Multiplex ทำงานแยกอิสระต่อกันในการ ดูภาพ บันทึกภาพ เล่นภาพ ระบบ network \r\n รองรับระบบเสียง 4 Input และ 1 Output \r\n มีระบบสำรองข้อมูล USB Backup \r\n มีระบบ LAN 10/100 สามารถดูภาพผ่าน Internet รองรับ TCP/IP, PPPOE, DHCP and DDNS\r\n รองรับการดูภาพด้วย โปรแกรม Internet Explorer, Mozilla Firefox or Google Chrome QuickTime \r\n สามารถดูภาพโดยแยกอิสระโดยไม่กระทบถึงหน้าจอหลัก\r\n รองรับผู้ใช้ สูงสุด 5 user\r\n รองรับการดูภาพผ่านโทรศัพท์ Windows Mobile / Iphone / BlackBerry\r\n มีรีโมทคอนโทรล และรองรับ Mouse USB ได้ \r\n มีระบบการแสดงภาพแบบลำดับภาพ และสามารถตั้งเวลาในการแสดงภาพได้\r\n มีระบบการ Zoom ภาพเมื่อดูภาพสด 2x\r\n สามารถคืนค่าในกรณีที่ไฟฟ้าดับและเปิดขึ้นมาเองโดยค่าต่างๆที่กำหนดไม่มีการเปลี่ยนแปลง\r\n รองรับระบบการรวมภาพจากหลาย DVR มากที่สุด 16 DVR และจำนวนกล้อง 256 กล้อง\r\n', 1, 0, 0),
	('ACC-HIP-CM300', 'HIP', 'CARD SYSTEM', '', '', '../images/product/product_icon_file_ACC-HIP-CM300.jpg', '../images/product/product_logo_file_ACC-HIP-CM300.jpg', '../images/product/product_image_file_ACC-HIP-CM300.jpg', 'HIP-CM 300 เป็นเครื่องบันทึกเวลาและควบคุมการเปิด-ปิดประตูด้วยระบบ Card ที่มีประสิทธิภาพสูง คุณสมบัติเด่นของตัว CM 300 นี้ คือสามารถรองรับ Card ได้ 30,000 และ 50,000 ใบ ซึ่งมากที่สุดในท้องตลาดขณะนี้ หน้าจอ Display มีขนาดใหญ่ สามารถแสดงผลได้ถึง 4 บรรทัด รองรับการใช้งานทั้งภาษาไทย และภาษาอังกฤษ เสียงตอบรับสามารถเปลี่ยนได้ตามลักษณะของ Display ที่แสดงบนตัวเครื่อง และสามารถตั้งกริ่งเตือนได้สูงสุดถึง 6 ช่วงเวลารองรับการทำงานใน รูปแบบ Standalone ซึ่งไม่จำเป็นต้องเชื่อมต่อกับเครื่องคอมพิวเตอร์ตลอดเวลามีหน่วยความจำในตัวเครื่อง ระบบปฏิบัติการใหม่ล่าสุดด้วย Linux Redboot 2.4.20 รองรับการทำงานได้หลากหลายง่ายต่อการพัฒนาระบบในอนาคต เพิ่มขีดความสามารถด้วยการรองรับ Flash Drive เวอร์ชั่น 1.1 และ 2.0 (ทุกยี่ห้อ) เพื่อการดึงข้อมูลจากตัวเครื่อง หรือส่งข้อมูลขึ้นไปยังตัวเครื่องซึ่งทำให้สะดวก และง่ายในบางพื้นที่ที่ไม่ต้องการติดตั้ง หรือเดินสายเพื่อใช้ในการรับส่งข้อมูล ดังนั้นเครื่องรุ่น HIP-CM 300 จึงนับได้ว่าเป็นเครื่องที่มีประสิทธิภาพสูงที่สุดในท้องตลาด RFID ในเรื่องของระบบบันทึกเวลา และระบบการเปิด-ปิดประตู', '', '', 1, 0, 0),
