	('ACC-HIP-CM200', 'HIP', 'CARD SYSTEM', '', '', '../images/product/product_icon_file_ACC-HIP-CM200.jpg', '../images/product/product_logo_file_ACC-HIP-CM200.jpg', '../images/product/product_image_file_ACC-HIP-CM200.jpg', 'HIP-CM 200 เป็นเครื่องบันทึกเวลาด้วยระบบ Card ที่มีประสิทธิภาพสูง คุณสมบัติเด่นของตัว CM 200 นี้คือสามารถรองรับ Card ได้ 30,000 และ 50,000 ใบ ซึ่งมากที่สุดในท้องตลาดขณะนี้ หน้าจอ Display มีขนาดใหญ่ สามารถแสดงผลได้ถึง 4 บรรทัด รองรับการใช้งานทั้งภาษาไทย และภาษาอังกฤษ เสียงตอบรับสามารถปรับเปลี่ยนได้ตามลักษณะของ Display ที่แสดงบนตัวเครื่อง และสามารถตั้งกริ่งเตือนได้สูงสุดถึง 8 ช่วงเวลา รองรับการทำงานใน รูปแบบ Standalone ซึ่งไม่จำเป็นต้องเชื่อมต่อกับเครื่องคอมพิวเตอร์ตลอดเวลามีหน่วยความจำในตัวเครื่อง สำหรับการเชื่อมต่อนั้นมีครบทุกฟังก์ชั่น คือการต่อแบบ RS232, RS485, TCP/IP ดังนั้นเครื่องรุ่น HIP-CM200 จึงนับได้ว่าเป็นเครื่องที่มีประสิทธิภาพสูงที่สุดในท้องตลาด RFID ในเรื่องของระบบบันทึกเวลาในปัจจุบัน', '', '', 1, 0, 0),
	('ACC-HIP-CM203', 'HIP', 'CARD SYSTEM', '', '', '../images/product/product_icon_file_ACC-HIP-CM203.jpg', '../images/product/product_logo_file_ACC-HIP-CM203.jpg', '../images/product/product_image_file_ACC-HIP-CM203.jpg', 'CM 203 Standalone Card Time Attendance System เป็นเครื่องที่ทำงานโดยใช้บัตร Proximity เพื่อบันทึกเวลาทำงานของพนักงาน ทดแทนเครื่องบันทึกเวลาแบบเดิม เช่น เครื่องตอกบัตร , เครื่องรูดบัตรแถบแม่เหล็ก และบาร์โค๊ด ที่มีปัญหาการอ่านยากเพราะต้องเสียดสีกับหัวอ่านตลาดเวลาจะหมดปัญหาด้วยความสามารถของเครื่อง CM203 ที่สามารถอ่านบัตรโดยไม่ต้องสัมผัสกับตัวเครื่อง รองรับบัตรได้ 30,000 ใบ และ 50,000 ใบ เก็บรายการบันทึกเวลาได้ 50,000 รายการ และ 80,000 รายการ สามารถเชื่อมต่อเพื่อดึงข้อมูลได้ครบทุกแบบการเชื่อมต่อมาตรฐาน RS232, RS485, TCP/IP และยังดึงข้อมูลจากตัวเครื่องโดยผ่าน USB Flash disk 128Mb. ที่แถมมากับตัวเครื่อง กรณีที่ไม่ต้องการเดินสายให้ยุ่งยาก', '', '', 1, 0, 0),
	('ACC-HIP-CM202', 'HIP', 'CARD SYSTEM', '', '', '../images/product/product_icon_file_ACC-HIP-CM202.jpg', '../images/product/product_logo_file_ACC-HIP-CM202.jpg', '../images/product/product_image_file_ACC-HIP-CM202.jpg', 'CM 202 Standalone Card Time Attendance System เป็นเครื่องที่ทำงานโดยใช้บัตร Proximity ที่มีความแข็งแรงไม่เกิดการชำรุดได้ง่าย เพราะไม่ต้องสัมผัสกับตัวเครื่องก็สามารถอ่านได้ และราคาถูก ตัวเครื่องออกแบบสวยงาม ทันสมัย แข็งแรงทนทาน ภายในใช้ระบบปฏิบัติการ Linux ที่สามารถประมวลผลได้อย่างรวดเร็วและ แม่นยำ สามารถรองรับบัตรได้ 30,000 ใบ และ 50,000 ใบ เก็บรายการบันทึกเวลาได้ 50,000 รายการและ 80,000 รายการ อ่านบัตรได้รวดเร็วไม่เกิน 1 วินาที เชื่อมต่อเพื่อดึงข้อมูลการทำงานได้ 3 รูปแบบ RS232, RS485, TCP/IP', '', '', 1, 0, 0),
