	('WI003.', 'SMC', 'SMCWBR14T_G', '2250', 'Baht per pcs', '../images/product/product_icon_file_WI003..jpg', '../images/product/product_logo_file_WI003..jpg', '../images/product/product_image_file_WI003..jpg', 'เป็นอุปกรณ์ Wireless Broadband Router 4-Port, Wireless Access Point ใช้มาตรฐาน IEEE802.11g ( Super G / Turbo )  \r\n  ทำให้สามารถรับส่งข้อมูลได้สูงสุดที่ 108Mbps, ความเร็ว 108 Mbps ( Super G / Turbo ),ใช้คลื่นความถี่ 2.4 GHz ซึ่งเป็นคลื่นเดียวกับมาตรฐาน IEEE802.11b \r\n', '', '', 1, 0, 0),
	('WI006', 'SMC', 'SMCWUSBT-G2', '1190', 'Baht per pcs', '../images/product/product_icon_file_WI006.jpg', '../images/product/product_logo_file_WI006.jpg', '../images/product/product_image_file_WI006.jpg', 'The SMC 802.11g 108Mbps Wireless USB Adapter (SMCWUSBT-G2) enables you to connect to 802.11g or 802.11b wireless networks at home, at the office or at public hotspots. The SMCWUSBT-G2 provides the speed, coverage, and security expected by todays wireless users when they communicate, download or upload large files, stream audio or video or use other bandwidth-intensive applications. ', '', '', 1, 0, 0),
	('WI007', 'SMC', 'SMCWPCIT-G', '1130', 'Baht per pcs', '../images/product/product_icon_file_WI007.jpg', '../images/product/product_logo_file_WI007.jpg', '../images/product/product_image_file_WI007.jpg', 'The EZ Connect&#8482; g 802.11g 108Mbps Wireless PCI Adapter (SMCWPCIT-G) is another cutting edge introduction in 2.4GHz wireless communication for your desktop computer. Designed for both business and home users, this Wireless PCI adapter provides the speed, coverage, and security expected by today\'s wireless users. Based on the IEEE 802.11g standard, the EZ Connect g Wireless PCI Adapter is 15 times faster than the widely used 802.11b wireless networking devices and is 100% compatible with existing 802.11b wireless networks. ', '', '', 1, 0, 0),
	('NE002.', 'SMC', 'SMC7904BRA', '1650', 'Baht per pcs', '../images/product/product_icon_file_NE002..jpg', '../images/product/product_logo_file_NE002..jpg', '../images/product/product_image_file_NE002..jpg', 'ADSL Modem โดยเป็นเทคโนโลยีแบบ ADSL2+ (Annex A),มี 4-Port LAN Switch (RJ-45), 10BASE-T/100BASE-TX,รองรับความเร็วในการ Download ข้อมูลสูงสุดถึง 24Mbps และ Upload ที่ความเร็วสูงสุด 1Mbps,มีระบบ DHCP ทำให้ง่ายต่อการจัดการในการเชื่อมต่อ,รองรับ SNMP ทำให้ง่ายต่อการจัดการระบบ', '', '', 1, 0, 0),
	('WI008.', 'BELKIN', 'Belkin Wireless G USB Network Adapter', '990', 'Baht per pcs', '../images/product/product_icon_file_WI008..jpg', '../images/product/product_logo_file_WI008..jpg', '../images/product/product_image_file_WI008..jpg', 'Adds 802.11g wireless capabilities to desktop and laptop computers, for faster wireless networking available for home or office Fits any standard 1.0, 1.1 and 2.0 USB slot Provides 3 times the wireless range of 802.11a adapters Offers backward-compatibility with all 802.11b network devices Features wireless 64- and 128-bit WEP Encryption Keeps notebook batteries running longer with advanced, low-power consumption chipset Comes with Belkin Lifetime Warranty and free 24-hour technical support', '', '', 1, 0, 0),
	('WI009', 'ASUS', 'Asus WL-167g USB2.0 WLAN Adapter ', '790', 'Baht per pcs', '../images/product/product_icon_file_WI009.jpg', '../images/product/product_logo_file_WI009.jpg', '../images/product/product_image_file_WI009.jpg', 'ASUS WL-167g USB2.0 WLAN Adapter (P/N: WL-167G) ใช้งานง่าย พกพาสะดวก ด้วยขนาดที่เล็กกะทัดรัดเพียงแค่ 75 x 25 x 9 มม. เท่านั้น และยังสามารถใช้งานร่วมกับมาตรฐานการสื่อสารแบบไร้สายแบบ IEEE 802.11g ได้อีกด้วย ในด้านประสิทธิภาพของการรับข้อมูลนั้นก็ไม่เป็นรองใคร เพราะไม่ว่าจะอยู่ในสภาพแวดล้อมที่เต็มไปด้วยสัญญาณรบกวนเพียงใด เช่น การทำงานของอุปกรณ์บลูธูทไร้สายในระบบ LAN ตัวอื่นๆ หรือแม้แต่คลื่นไมโครเวฟรบกวนก็ตาม WL-167G ก็ยังสามารถบันทึกข้อมูลได้อย่างเต็มประสิทธิภาพ นอกจากนั้นยังได้รับการออกแบบมาให้มีการใช้งานซีพียูที่ต่ำที่สุด ซึ่งจะช่วยให้ภายในระบบมีพื้นที่ว่างที่เพียงพอสำหรับฟังก์ชันอื่นๆ ในส่วนของระบบการรักษาความปลอดภัย ยังได้มีการเพิ่มประสิทธิภาพขึ้นด้วยการสนับสนุนระบบ WEP ที่ 64/128 บิต พร้อมกันนี้ยังสามารถทำงานร่วมกับ Windows XP SP1 security WPA functions ได้อีกด้วย\r\n', '', '', 1, 0, 0),
