INSERT INTO `tb_project_building` (`description`, `image`, `image_desc`, `desc_from`) VALUES
	('        บริษัท เอลตัส ฯ ได้พิจารณาถึงกระบวนการและขั้นตอนการปฏิบัติงานของผู้ใช้ระบบ โดยจะมีการดำเนินงานเกี่ยวกับการนำระบบ มาประยุกต์ใช้กับองค์กรลูกค้า เพื่อให้บรรลุตามเป้าหมายที่วางไว้\r\n\r\n1.	Survey สำรวจระบบงาน ก่อนการเซ็นสัญญาว่าจ้างหรือซื้อขาย เพื่อให้ทราบวัตถุประสงค์และเป้าหมายขององค์กรผู้ใช้ระบบ โดยจะรวบรวมหัวข้อและขอบเขตของงานแบบสังเขปพอเป็นแนวความคิดเพื่อเสนอราคาและจัดทำระยะเวลาการทำงาน  ทั้งนี้ในกรณีที่องค์กรลูกค้ามีระบบงานเก่าอยู่แล้ว ทีมงานจะคำนึงถึง การนำข้อมูลเก่ามาใช้งาน และจะตรวจสอบว่าข้อมูลเก่าที่จะขึ้นมาอยู่บนระบบใหม่จะสมบูรณ์หรือไม่กี่เปอร์เซ็นต์\r\n\r\n2.	Sign Contract การเซ็นสัญญาว่าจ้างหรือซื้อขาย จัดทำการเซ็นสัญญา โดยจะประกอบด้วยข้อมูลที่ทำการสำรวจและระยะเวลาในการดำเนินงาน รวมถึงเงื่อนไขการดูแลและรักษาระบบ รวมทั้งเงื่อนไขการชำระเงิน และกำหนดการตรวจสอบสถานะของโครงการ\r\n\r\n3.	Survey & Design สำรวจระบบงานหลังการเซ็นสัญญา (Survey & Design) การสำรวจด้านระบบงานจะสำรวจถึงขั้นตอนการปฏิบัติงานที่ปฏิบัติอยู่ในปัจจุบันอย่างละเอียด ประเภทของข้อมูลนำเข้า การนำเข้าข้อมูลและผลลัพธ์ และความต้องการขององค์กรลูกค้า โดยจะมีการทำ ขั้นตอนการดำเนินงาน (Workflow) ให้เห็นว่าการทำงานในขั้นตอนใดสามารถที่จะปรับปรุงให้ดีขึ้นหรือสามารถนำเอาเทคโนโลยีสารสนเทศมาประยุกต์ใช้งานแทนได้ ก็จะนำเป็นข้อเสนอและมีการประชุมร่วมกัน\r\n\r\n4.	Requirement & Agreement หลังจากที่ทำการสำรวจระบบงานโดยละเอียด ทีมงานจะจัดทำแม่แบบของการพัฒนาระบบ (Prototype) จะเป็นเอกสารประกอบการทำงานในลักษณะของหน้าจอการป้อนข้อมูล ประเภทของข้อมูล และรูปแบบรายงานที่พิมพ์ออกจากเครื่องพิมพ์หรือหน้าจอ เพื่อให้มีการตกลงร่วมกัน ทั้งความเข้าใจถึงรายละเอียดของงาน และผลกระทบ หากส่วนใดเห็นว่าไม่ถูกต้อง ก็จะสามารถทำการแก้ไขให้ระบบงานเป็นไปตามเป้าหมายที่วางเอาไว้ โดยการเปลี่ยนแปลงจะอยู่บนพื้นฐานของความเข้าใจร่วมกัน ซึ่งจะมีขั้นตอนที่สมเหตุผล และได้ผลงานที่ดีที่สุด \r\n\r\n5.	Tuning System ภายหลังจากการยืนยันและยอมรับกับเอกสารแม่แบบ (Prototype) ของระบบ\r\nงานเรียบร้อยแล้วทีมงานจะทำการรวบรวมเอกสารอีกครั้งหนึ่งเพื่อความคล่องตัวและเป็น       มาตรฐานในการทำงาน ทั้งด้านรูปแบบหน้าจอและรายงาน ตลอดจน Feature ที่ต้องเพิ่มเติมหลังจากนั้นทีมงานจะทำการสร้างโปรแกรมตามแม่แบบ โดยการพัฒนาระบบโปรแกรมนั้นจะแบ่ง\r\nModule ตามแผนงานและระยะเวลาในการพัฒนาระบบ โดยการทำงานนั้นจะมีรายงานกับเจ้าของงาน เป็นระยะ ๆ (Milestone)\r\n\r\n6.	Implementation เพื่อให้ลูกค้าทราบถึงขีดความสามารถของระบบ ที่มีความถูกต้องแม่นยำ สั่งงานได้ตรงตามที่ต้องการ เชื่อถือได้ มีความสมบูรณ์ ทบทวนต่อความผิดพลาดในระบบได้มี    ประโยชน์  มีประสิทธิภาพสามารถพิสูจน์คุณภาพ และบำรุงรักษาได้ง่าย ให้ลูกค้าได้ทราบ และ   จัดสรรหน่วยงานที่เกี่ยวข้อง เพื่อขั้นตอนการ Implement  ดังนี้\r\n        6.1	Demonstration  ทีมงานจะทำการติดตั้งระบบงานเป็นส่วน ๆ ณ. ที่ทำการของลูกค้าโดยหน่วยงานที่เกี่ยวข้องเพื่อทำการ Presentation เป็นขั้นตอนแรกและจะมีการถามตอบถึง  ปัญหาและวิธีการทำงาน ตลอดจนขั้นตอนการทำงาน Function การทำงานต่าง ๆ ของระบบงาน\r\n\r\n        6.2	Modification หากขั้นตอนในหัวข้อ 6.1 มีข้อบกพร่องหรือมีข้อโต้แย้งจากผู้ใช้ ทีมงานจะ\r\nมีการทำบันทึกในที่ประชุม และนำมาปรับปรุงแก้ไขให้สมบูรณ์โดยเร็ว ทั้งนี้ให้ยึดถือเอกสารแม่  แบบ (Prototype) เป็นหลัก\r\n\r\n         6.3	Training โดยทีมงานจะจัดเตรียมความพร้อม เพื่อจัดฝึกอบรม ตามหน่วยงานที่เกี่ยวข้อง โดยจะมีการอธิบายถึงการใช้งานอย่างละเอียด ข้อควรระวัง รวมถึงการบำรุงรักษาระบบในเบื้องต้น\r\n', '../images/business/project_building.gif', 'Workflow Diagram', '');
INSERT INTO `tb_project_management` (`description`, `image`, `image_desc`, `desc_from`) VALUES
	('	การสร้างระบบงาน ทีมงานมีความคำนึงถึงประสิทธิภาพทั้งการใช้งานในปัจจุบันและอนาคต โดยระบบต้องมีความถูกต้องและแม่นยำ สั่งงานได้ตรงตามที่ต้องการ เชื่อถือได้ มีความสมบูรณ์ ทบทวนต่อความผิดพลาดในระบบได้ มีประโยชน์  มีประสิทธิภาพสามารถพิสูจน์คุณภาพ และบำรุงรักษาได้ง่าย\r\n\r\n1.	ความถูกต้องของโปรแกรม (Correctness) หมายถึงการที่โปรแกรมสั่งงานได้ตรงตามข้อกำหนดลักษณะที่ระบุเอาไว้ แสดงว่าข้อกำหนดลักษณะจะต้องระบุเอาไว้ในลักษณะที่สามารถตรวจสอบได้ว่าโปรแกรมสั่งงานได้ตรงตามข้อกำหนดลักษณะ เหล่านั้นหรือไม่\r\n\r\n2.	ความแม่นยำของคำตอบ (Accuracy) ได้แก่การที่ผลลัพธ์จำนวนจริงที่คำนวณได้มีค่าต่างไปจากค่าแท้จริงมากจนเรายอมรับว่าผลลัพธ์ถูกต้อง แสดงว่าจะต้องมีการวิเคราะห์กระบวนการควบคุมค่าปลายสุดซึ่งเป็นค่าขนาดใหญ่ หรือขนากเล็กมาก ๆ ของโปรแกรมและอาจต้องมีการวิเคราะห์ความคลาดเคลื่อนของอัลกอริทึม\r\n\r\n3.	การสั่งงานได้ตรงตามที่ต้องการ (Validity) ได้แก่การที่โปรแกรมสั่งงานได้ตรงตามเนื้อหาที่ต้องการในทุกส่วนของระบบการประมวลผล ไม่ใช่เฉพาะเพียงส่วนหนึ่งส่วนใดเท่านั้น\r\n\r\n4.	ความเชื่อถือได้ (Reliability) หมายถึงการที่ทุกส่วนทำหน้าที่ได้เหมือนกันทุกครั้ง แม้ว่าจะไม่มีคอมพิวเตอร์เครื่องใด หรือโปรแกรมชุดใดที่มีความเชื่อถือได้อย่างสมบูรณ์แบบก็ตาม  แต่พบว่าความน่าเชื่อถือจะเพิ่มขึ้นถ้ามีการสร้างกระบวนการตรวจสอบด้วยตัวเองหรือกระบวนการตรวจสอบซ้ำ (Redundancy Check) ขึ้นในระบบ\r\n\r\n5.	ความสมบูรณ์ หมายถึงการที่โปรแกรมใช้ได้กับข้อมูลทุกชุดที่อาจเป็นได้และมีระบบป้องกันข้อผิดพลาดที่ไม่น่าเกิดขึ้นในการป้อนข้อมูลด้วย\r\n\r\n6.	ความทนทานต่อความผิดพลาดในระบบ (Robustness) ได้แก่ความสามารถในการปฏิบัติหน้าที่ได้ต่อไป แม้จะพบข้อผิดพลาดบางประการในระบบก็ตาม ปัญหาข้อนี้มีความสำคัญมากโดยเฉพาะในระบบการประมวลผลข้อมูลที่ต้องใช้เวลามากๆในกระบวนการที่ต้องการผลลัพธ์แบบทันทีทันใด เพราะความผิดพลาดบางอย่างอาจทำให้เครื่องคอมพิวเตอร์หยุดทำงานในเวลาที่ไม่เหมาะสม อาจก่อให้เกิดความเสียหายร้ายแรงได้\r\n\r\n7.	คุณประโยชน์ได้แก่ขีดความสามารถในการใช้โปรแกรม \r\n\r\n8.	ประสิทธิภาพ ได้แก่การใช้ทรัพยากรของระบบที่มีอยู่ได้อย่างคุ้มค่าและเหมาะสม\r\n\r\n9.	การพิสูจน์คุณภาพ ได้แก่ความสามารถในการแสดงคุณภาพด้านต่าง ๆ ของระบบเช่น ความ ถูกต้อง ความสมบูรณ์ ของระบบงาน โดยอาจใช้วิธีการทางคณิตศาสตร์พิสูจน์ว่าโปรแกรมสั่งงานได้ตรงตามข้อกำหนดและให้ผลลัพธ์ออกมาที่แม่นยำ\r\n\r\n10.	การบำรุงรักษา หมายถึงการมีความพร้อมในการปรับปรุงโปรแกรมให้สอดคล้องกับการเปลี่ยนแปลงของเงื่อนไขบางประการ การบำรุงรักษานี้มีความสัมพันธ์อย่างใกล้ชิดกับการออกแบบ การเขียนเอกสารประกอบ และวิธีการเขียนโปรแกรม\r\n\r\n11.	ข้อปัญหา ในการออกแบบระบบงานประยุกต์นั้น สิ่งแรกที่จะต้องกระทำคือการทำความเข้าใจอย่างถ่องแท้ในระบบงานเดิม  ที่ต้องการเปลี่ยนให้เป็นระบบงานที่ใช้คอมพิวเตอร์\r\nข้อกำหนดของระบบงานเพียงอย่างเดียวไม่ได้ช่วยให้สามารถมองเห็นโครงรูปทั้งหมดได้\r\n\r\nคุณภาพของโปรแกรมในด้านต่าง ๆ เหล่านี้เป็นผลมาจาก ความรู้ ความชำนาญของ\r\nนักออกแบบ และสร้างโปรแกรม   โปรแกรมที่ใช้งานส่วนมากจะเป็นส่วนหนึ่งของหน่วยงานในองค์กร โดยเกี่ยวข้องกับการเก็บรวบรวมข้อมูล การบันทึก และการประมวลผลข้อมูล โปรแกรมต่าง ๆ เหล่านี้จะรวมกันเป็นระบบงานขององค์กรและเกี่ยวข้องกับผู้คนเป็นจำนวนมาก เพื่อให้ผู้ใช้เกิดความรู้สึกที่ดี โปรแกรมจึงไม่เพียงแต่จะมีประโยชน์ เชื่อถือได้และมีประสิทธิภาพเท่านั้น ยังต้องชัดเจน และเข้าใจง่ายอีกด้วย สิ่งเหล่านี้ถือเป็นแนวทางกว้าง ๆ ในการพัฒนาระบบงาน ดังนั้นการพัฒนาระบบและผลลัพธ์ที่ได้จะต้องคำนึงถึงผู้ใช้งานเป็นหลัก\r\n---------------------------------------------###-------------------------------------------------\r\n', '../images/business/project_management.JPG', '                ', '');
