	('Tailor made Software เป็นธุรกิจ Software อีกอย่างหนึ่ง ซึ่งการพัฒนาระบบนี้ จะทำการวิเคราะห์   และออกแบบโครงสร้างข้อมูล โดยจะคำนึงถึง     คุณภาพและค่าใช้จ่ายอย่างสมเหตุผล และอ้างอิงการพัฒนาระบบตามความต้องการขององค์กรลูกค้า        โดยทีมงานที่มีคุณภาพและประสบการณ์  ทั้งที่เป็นระบบ Business Application และ Web Application  ด้วยโปรแกรมเขียน Visual Studio .NET,Delphi,Java, ASP,VB 6 และการจัดการฐานข้อมูล Informix, SQL Server, Access, PostGreSQL, Oracle\r\n', '../images/business/tailor_made_software.JPG', '', '');
